import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';

// routes
import CarInsurance from './pages/car-insurace';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path='/'element={CarInsurance}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
